import { Grid, Typography } from '@material-ui/core';
import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';
import DoneIcon from '@material-ui/icons/Done';

function EachNode(props) {
	return (
		<Grid direction="row" container className="each-to-do">
			<Grid xs="3" align="end" className="each-to-do">
				{' '}
				<DoneIcon></DoneIcon>
			</Grid>
			<Grid xs="6">
				{' '}
				<Typography align="center">{props.toDo}</Typography>
			</Grid>
			<Grid xs="3" align="start" className="each-to-do">
				{' '}
				<DeleteIcon></DeleteIcon>
			</Grid>
		</Grid>
	);
}

export default EachNode;
